def add_adventure_sale(address, amount):
	user_record = EtheremonDB.UserTab.objects.get(address=address)
	bonus_record = EtheremonDB.EmontBonusTab.objects.filter(uid=user_record.uid).first()
	if not bonus_record:
		bonus_data = {
			"facebook": 0,
			"twitter": 0,
			"adventure_presale_bonus": amount
		}
		user_manager.create_bonus_info(user_record.uid, json.dumps(bonus_data), get_timestamp())
	else:
		bonus_data = json.loads(bonus_record.bonus_data)
		bonus_data["adventure_presale_bonus"] = amount
		bonus_record.bonus_data = json.dumps(bonus_data)
		bonus_record.save()

# insert bonus
